Event.create({"title"=>"Swing It Berlin!", "website"=>"http://www.swingitberlin.com", "description"=>"Swing It Berlin! returns with an even more exciting lineup for 2025! Celebrating the 8th year of Swing Base, we're thrilled to present a fantastic mix of international and local swing talents - and even a Big Band - in two amazing ballrooms: Clärchens and Peter Edel. At our main parties, the heart of Berlin will come alive with two swingin' bands taking the stage on the same night at Clärchens, our stunning venue. Look forward to dazzling showcases, spirited competitions, high-quality classes, and inspiring taster sessions to improve your swing skills. We can't wait to see you there - let's swing into the new year in vibrant Berlin!", "start_date"=>"2025-01-23 12:00am", "end_date"=>"2025-01-26 12:00am", "city"=>"Berlin", "country"=>"Germany"})
